namespace TestProject
{
    public class FirstUniqueCharTests
    {
        [Fact]
        public void Test1()
        {
            var sub = new FirstUniqueChar();

            var result = sub.FirstUniqChar("leetcode");

            result.Should().Be(0);
        }

        [Fact]
        public void Test2()
        {
            var sub = new FirstUniqueChar();

            var result = sub.FirstUniqChar("loveleetcode");

            result.Should().Be(2);
        }

        [Fact]
        public void Test3()
        {
            var sub = new FirstUniqueChar();

            var result = sub.FirstUniqChar("aabb");

            result.Should().Be(-1);
        }

        [Fact]
        public void Test4()
        {
            var sub = new FirstUniqueChar();

            var result = sub.FirstUniqChar("");

            result.Should().Be(-1);
        }
    }
}
